import { Navigate } from "react-router-dom"

function ProtectedRoute({ element: Component, loggedIn, userEmail, ...props }) {
    return(
        loggedIn ?
        <Component {...props} />        
        : <Navigate to={'/sign-in'} replace />
    )
}

export default ProtectedRoute;
